    (Technically: the merge-base of the selected revision and HEAD is used to determine the start of the commit range.)' => 'Vous exécutez une commande qui opère sur une plage de versions (d’habitude, d’une révision quelconque à « HEAD ») mais vous n’avez pas spécifié la révision qui détermine le début de la plage.
